.custom-node {
  width: 50px;
  height: 50px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-weight: bold;
}

.custom-node-color-2 {
  width: 200px;
  height: 200px;
  background-image: url('AJ_Digital_Camera.svg');
}

.circle-node {
  border-radius: 50%;
}

.triangle-node {
  clip-path: polygon(50% 0%, 0% 100%, 100% 100%);
}

.pentagon-node {
  clip-path: polygon(50% 0%, 100% 38%, 82% 100%, 18% 100%, 0% 38%);
}
